        "activities": "Cardio, Strength Training",
        "alias": "hot-powerflow-hiit",
        "description": "This 45 minute class is PowerFlow Yoga's spin on circuit-style training that combines strength training with high intensity interval training movements (HIIT) to tone your body, increase cardiovascular endurance, boost your metabolism, build lean muscle, and burn fat!Powerflow HIIT is performed in a moderately heated room to create rapid results, sweat out toxins, improve circulation, develop strength, and increase mobility. Class begins with a yoga flow warm-up and ends with a yoga flow cool-down, the HIIT circuits in the middle are designed to deliver a sweaty, heart-pumping total body workout: abs, arms, legs, glutes, back, and core! All skill levels welcome! All movements can be modified to low impact and/or advanced progressions can be offered. Powerflow HIIT is set to upbeat, high energy music. This class is beat driven, meaning your movements and repetitions BPM (beats per minute) will sync with the beat energy of the music in class. This class is so fun and addicting you won't be able to get enough of it!",
