        "alias": "warm-yin-yang-yoga",
        "description": "Warm Yin Yang Yoga blends the dynamic workout of a Hot Powerflow Vinyasa class with the slow-building intensity of a meditative yin yoga practice. This class will typically begin with yin yoga postures, which target the body’s dense connective tissues. You’ll hold these poses for a bit longer (3 to 5 minutes), allowing you to surrender and release deeply held tension. Then, the intensity builds as you move through a sweaty, powerful and challenging vinyasa flow to strengthen your muscles. At the end, more soothing and gentle yin yoga postures will be offered to help you unwind from class. This class offers you the toolbox you need to quiet an overactive mind while you enjoy the vigorous workout you’ve come to love. Yogis of all levels will leave class feeling nourished and well-rested.",
