        "description": "Dharma Yoga is a graceful, yet challenging form of yoga based on Sri Dharma Mittra’s almost 60 years of practice of classical yoga. As students move through the different series, they are encouraged to go deeper and experience the practice in a meditative and spiritual way. In essence, Dharma Yoga is a system of classical Hatha-Raja Yoga. A devotional practice that emphasizes good health, a clear mind and a kind heart. The method weaves together many teachings in order to bring all students closer to the goal of Self-realization. This is a physically challenging class. A MINIMUM OF 10 YOGA CLASS EXPERIENCE REQUIRED.",
