        "alias": "evidence-based-tai-chi-and-qigong",
        "description": "T’ai chi is an ancient Chinese form of low-impact, meditative exercise that cultivates mind, body and spirit. Developed as a martial art, t’ai chi is practiced today mainly for healthy living and personal development. It improves agility, balance, strength, coordination, flexibility, vitality, confidence and peace of mind.\nIn this fun, relaxing, and invigorating class, you’ll learn the three complementary practices of traditional t’ai chi training: qigong, which includes sitting, standing, and moving meditation; t’ai chi form, a choreographed series of slow, mindful and deceptively powerful movements; and push hands, a noncompetitive two-person training exercise involves sensing the energy of self and others. Evidence-based t’ai chi (EBT), developed by Dr. Yang Yang, a leading t’ai chi and qigong master, distills these traditional training practices into a highly efficient program that’s been shown in rigorous scientific studies to offer multiple benefits. Traditional faster-paced exercises further cultivate agility and add cardio benefits.",
