        "alias": "prepostnatal-pilates-with-props-1689b91977b",
        "description": "Pilates is the one of the BEST things you can do to prepare your body for child birth and restore your body after birth. This class was designed to be safe and effective for every level of fitness and every stage of pregnancy and BEYOND. Mamas in the 1st, 2nd and 3rd trimester as well as the early postartum recovery phase (6 weeks postpartum-3 months) are welcome to attend this class. In this class, we do lots of stretching to help with the aches and pains of pregnancy/motherhood. We focus on core strengthening to help prevent diastisis recti PREnatal and restore your core POSTnatal. We learn how to do Kegels properly. Best of all, we work and tone on all the peripheral parts of your body that aren't/weren't pregnant (legs, arms, & butt). We provide all the mats and props at no extra charge so all you need to bring is YOU! Benefits of this class: -Better posture -Core and pelvic floor strength and connection -Preventing diastasis recti PREnatal -Restoring the core POSTnatal -Stability of the hips and lower back -Reduce back pain -Quicker recovery and return to pre-pregnancy body",
