        "alias": "candlelight-flow-with-yoga-nidra",
        "description": "The perfect way to end your busy work week...slow down and reconnect, moving mindfully but powerfully, and breathing deeply. Slowing down the flow can help you maintain control of your breath, build determination, and intensify your practice. True to it's name, Sattva Slow Flow is a smooth linking of unhurried breath with movement, intensified by mindfully holding postures for several breaths, awakening your body and clearing your mind. Explore the details of each posture at a comfortable pace to allow your body to deepen into a stretch or pause in a strength-building pose. Get into the rhythm of this truly invigorating class and find true balance in this moving meditation. The last 15 minutes of class are spent in complete relaxation through Yoga Nidra, a guided meditation practice designed to liberate the body and mind from tension and anxiety. Known as the “wakeful sleep”, one learns how to put the body into sleep while the mind remains fully awake. The brain wave drops into the theta state where deep levels of healing takes place on the emotional, mental, and physical planes. Class is 75 minutes All levels are welcome, some vinyasa experience suggested",
