        "alias": "dharma-gentle-yoga",
        "description": "This healing session is appropriate for all ages and anyone who wishes to add the healing qualities of yoga into their lives. During the sequence of postures students will be encouraged to move the body slowly, gently and conscientiously. Brief rest is taken between poses which will help the body relax from stress and tension and move the mind toward a more peaceful and meditative state. This class is highly beneficial for those returning from an illness or injury, or who haven’t moved in a long time. It is recommended for those who are looking for an easy class. Everyone will leave feeling refreshed and relaxed.",
