        "alias": "urban-oasis-restorative-16b67502fb0",
        "description": "Unlike an active practice, which moves you from pose to pose building heat, strength and flexibility in equal measure—Restorative Yoga invites you to slow down and JUST BE. You’ll release deeply held tension by “steeping” in passive, supported poses. It’s yummy! And bonus: It soothes the nervous system, relaxes muscles on a cellular level, deepens self awareness, and encourages mindfulness. Amidst a mellow soundscape and after some gentle movement, we’ll use bolsters, blankets and blocks to prop the body in a variety of poses (while the teacher tiptoes around making sure you’re just right). Physical stress dissolves and the mind moves into stillness as you disconnect from frenetic daily life—and reconnect with your best self. By the end of the session, you’ll feel exactly as you should—luxuriously open and undeniably chill. You may even glow. OPEN LEVEL.",
