        "activities": "Yoga",
        "alias": "urban-drift-yin-yoga-nidra-16b67503088",
        "description": "In short, this yummy combination of Yin Yoga and Yoga Nidra is not only a treat, but may become your next healthy addiction. We’ll start with the Yin, which engages prolonged holding to not only stretch our muscles, but to move directly into the connective tissues that hold everything in place. While it works on all levels, it pays particular attention to the fascia and ligaments of the hips, pelvis, and lower spine. But don’t let the grounded nature and stillness of these postures fool you—it can be quite challenging due to the longer holding. But with practice, you’ll feel just how therapeutic Yin Yoga is… Especially when followed by Yoga NIdra! After our Yin practice we’ll settle into a prone position on our backs and drift away for final relaxation in the form of Yoga Nidra—which is defined as the state of consciousness between waking and sleeping. You’ll go on a guided meditation that systematically relaxes every part of the body, as the teacher uses verbal cues and inspiring visuals. You’ll become increasingly aware of your inner world, and at the same time, blissfully relaxed. Bring it on!",
