        "description": "Every muscle and organ is surrounded by connective tissue called fascia. This fascia surrounds us like saran wrap and helps give our body structure. When fascia is dehydrated or inflamed, our muscles can stick to one another causing pain and limited mobility. The negative pressure provided by fire cupping relieves spasms and adhesions and helps loosen the muscles by physically separating this fascia. This promotes oxygenation of the tissue, improving circulation and as a result, detoxifies the body. Marks may appear on the body and the darkness and intensity show how much toxicity has built up. They can take 3-10 days to fade depending on the strength and energy of the individual. Cupping is often used to alleviate back and neck pain, but can be also used for anxiety, fatigue, migraines, rheumatism, and insomnia. It is also great for symptoms of common cold, cough, and asthma. Cupping is usually combined with acupuncture in one treatment, but it can be used alone as well.\r\n\r\nClass/service/experience descriptions are provided by our partners. ClassPass does not represent or warrant that the descriptions are complete, accurate, reliable, or current.",
